import React from 'react';
import Mikkel from '../../assets/images/mikkel.svg';
import Frederik from '../../assets/images/frederik.svg';
import Niels from '../../assets/images/niels.svg';
import Grid from '@material-ui/core/Grid';
import { Card, CardTitle, Icon } from 'react-materialize';


const services = props => {
  return (
    <div className="">
        
        <Grid container  >
        <Grid item md={2} xs={1}>
      </Grid>
      <Grid container md={8} xs={10}>
      <Grid container md={12} justify="center"
  alignItems="center">
          <h2>Our mission</h2>
          
          </Grid>
          <Grid container md={12}>
          <Grid item md={4} xs={12}><Card
      actions={[
        <a key="1" href="#">This is a Link</a>
      ]}
      
      header={<CardTitle image={Mikkel}>Card Title</CardTitle>}
      
    >
      Here is the standard card with an image thumbnail.
    </Card></Grid>
          <Grid item md={4} xs={12}></Grid>
          <Grid item md={4} xs={12}></Grid>
          
          </Grid>
          <Grid item md={3}></Grid>
      </Grid>
      
      <Grid item md={2}>
      </Grid>
      </Grid>
</div>
  );
    
};

export default services;
